import React, { useEffect, useState } from 'react';
import { apiConsultarProcesos } from '../api/auth';

const ProcesosPage = ({ setNotification }) => {
    const [procesos, setProcesos] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        const fetchProcesos = async () => {
            try {
                const token = localStorage.getItem('authToken');
                const data = await apiConsultarProcesos(token);
                setProcesos(data.procesos || []);
            } catch (e) {
                setNotification('Error al cargar procesos', 'error');
            }
            setLoading(false);
        };
        fetchProcesos();
    }, [setNotification]);

    if (loading) return <div className="p-8">Cargando procesos...</div>;

    return (
        <div className="p-8">
            <h2 className="text-2xl font-bold mb-4 text-sky-400">Procesos</h2>
            <ul className="space-y-2">
                {procesos.map((p) => (
                    <li key={p._id} className="bg-slate-700 p-4 rounded">
                        <span className="font-semibold">{p.nombre || p.titulo || 'Sin nombre'}</span>
                        {/* Agrega más campos según tu modelo */}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default ProcesosPage;
